import { Backdrop, Box, withStyles } from "@material-ui/core";
import React from "react";

interface IProps {
  isOpen: boolean;
  handleClose: Function;
}

const Dialog: React.FC<IProps> = ({ isOpen, handleClose }) => {
  return (
    <>
      {isOpen && (
        <Backdrop open={!isOpen} onClick={() => handleClose()}>
          yooo
        </Backdrop>
      )}
    </>
  );
};

export default Dialog;
